import React from 'react';
import coffeemug from './coffee-mug.jpg';
function Products() {
    
    return (
        <section id='products'>
    <div class="card" style={{width : '18rem', marginTop : '50px'}}>
        <img src="./coffee-mug.jpg" class="card-img-top" alt="picture of a coffee mug"></img>
            <div class="card-body">
                <p class="card-text">Item: Coffee Mug</p>
                <p class="card-text">Price: $20.00</p>
                <p class="card-text">Description: Ready to go customizable coffee mug!</p>
                </div>
  </div>
  </section>
  )
}

export default Products;
